import Link from 'next/link'
import $ from 'jquery'
import React from 'react';



export default function Navbar() {

    const mobileMenuOpen = () =>{
        $('.af-class-mobile-nav').slideToggle();
    }
    const mobileMenuClose = () =>{
        $('.af-class-mobile-nav').slideUp();
    }

    const mobileToggleOpen = (num) =>{
        $('.mobile-dropdown').slideUp();
        $('.mobile-dropdown-' + num).slideToggle();
    }


    const menuOpen = (num) =>{
        $('.dropdown-'+num).show();
    }

    const menuClose = () =>{
        $('.w-dropdown-list').hide();
    }

    return(
        <span className="af-view">

        
        <style jsx>
            {` 
            @media screen and (max-width: 991px){
              .w-dropdown-list{
                position: relative;
            } 
            }
            .w-dropdown-list{
              border-radius: 10px;
          } 
            .af-class-mobile-dropdown{
                display: block !important;
            }
            .af-class-mobile-nav-link {
                display: -webkit-box;
                display: -webkit-flex;
